import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [commands, setCommands] = useState(null)

  // useEffect( , [])

  const fetchData = () => {

    fetch("http://localhost:5000/api/command/all")
    .then( res => setCommands(res.body))


  }

  return (
    <div className="App">
      <h1>hola</h1>
      {commands ? commands.map(comanda => <p>{JSON.stringify(comanda)}</p>) : <></>}
      <button onClick={fetchData} >Fetch</button>
    </div>
  );
}

export default App;
